import React from 'react';

export default function About() {
  return (
    <div>
      <h1>About Me</h1>
      <p>
      My name is Christian Jimenez and I am a full-stack software developer. This is my portfolio which I built
      using React. In this portfolio you will find my contact information, a list of a few of the projects I have worked on
      </p>
    </div>
  );
}
